-IT/it-IT.mod_languages.ini'),(2974,'MOD_LANGUAGES_FIELD_DROPDOWN_LABEL','Usa menu a tendina','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_languages.ini'),(2975,'MOD_LANGUAGES_FIELD_FOOTER_DESC','Testo o HTML da visualizzare sotto alla Scelta lingua','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_languages.ini'),(2976,'MOD_LANGUAGES_FIELD_FOOTER_LABEL','Testo successivo','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_languages.ini'),(2977,'MOD_LANGUAGES_FIELD_FULL_NAME_DESC','Se impostato su \'Sì\' e le bandiere su \'No\', verranno visualizzati i nomi delle lingue contenuto. Se impostato su \'No\', verranno utilizzate le abbreviazioni del Codice lingua URL in maiuscolo. Esempio: EN per l\'inglese, IT per l\'italiano.','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_languages.ini'),(2978,'MOD_LANGUAGES_FIELD_FULL_NAME_LABEL','Nome lingue esteso','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_languages.ini'),(2979,'MOD_LANGUAGES_FIELD_HEADER_DESC','Testo o HTML da visualizzare sopra alla Scelta lingua','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_languages.ini'),(2980,'MOD_LANGUAGES_FIELD_HEADER_LABEL','Testo precedente','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_languages.ini'),(2981,'MOD_LANGUAGES_FIELD_INLINE_DESC','Di default è impostata su \'Sì\', ossia visualizzazione orizzontale.','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_languages.ini'),(2982,'MOD_LANGUAGES_FIELD_INLINE_LABEL','Visualizzazione orizzontale','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_languages.ini'),(2983,'MOD_LANGUAGES_FIELD_MODULE_LAYOUT_DESC','Usa un diverso layout da quello del modulo o sovrascrivi il template predefinito.','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_languages.ini'),(2984,'MOD_LANGUAGES_FIELD_USEIMAGE_DESC','Se impostato su \'Sì\', visualizzerà la scelta lingua con delle bandiere. Altrimenti utilizzerà i nomi delle lingue contenuto.','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_languages.ini'),(2985,'MOD_LANGUAGES_FIELD_USEIMAGE_LABEL','Usa immagini bandiere','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_languages.ini'),(2986,'MOD_LANGUAGES_OPTION_DEFAULT_LANGUAGE','Predefinito','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_languages.ini'),(2987,'MOD_LANGUAGES_SPACERDROP_LABEL','<u>Se \'Usa menu a tendina\' è impostato su \'Sì\',<br /> le seguenti opzioni verranno ignorate</u>','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_languages.ini'),(2988,'MOD_LANGUAGES_SPACERNAME_LABEL','<u>Se \'Usa immagini bandiere\' è impostato su \'Sì\',<br /> le seguenti opzioni verranno ignorate</u>','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_languages.ini'),(2989,'MOD_LANGUAGES_XML_DESCRIPTION','Questo modulo visualizza la lista delle Lingue Contenuto disponibili (definite e pubblicate nel tab Contenuti della Gestione Lingua) per poterle intercambiare tra di loro e usare Joomla! come un sito multilingua. <br />-- Il plugin \'System - Language Filter\' dev\'essere abilitato. --<br /> Quando si cambia una lingua e se la voce di menu che visualizza la pagina non è associata ad un\'altra voce di menu, il modulo redireziona alla Home page definita per la lingua scelta. <br /> Altrimenti, se il parametro è impostato nel plugin Language Filter, redirezionerà alla voce di menu associata alla lingua scelta. Quindi, la navigazione sarà quella definita per la lingua.<br />Se il plugin <strong>\'System - Language Filter\'</strong> non è abilitato, potrebbero esserci dei risultati non desiderati.<br /><strong>Metodo:</strong><br />1. Apri il tab Contenuti in Gestione lingua ed assicurati che le lingue che vuoi utilizzare nei contenuti siano pubblicate e abbiano un prefisso per gli URL e un prefisso per l\'immagine utilizzata nel modulo.<br />2. Crea una Home page per ciascuna lingua pubblicata assegnando una lingua alla voce di menu e definendola come Home page predefinita. <br />  3. Quindi, puoi assegnare una lingua a qualsiasi articolo, categoria, modulo, newsfeed, link web in Joomla.<br /> 4. Assicurati che il modulo sia pubblicato e che il plugin sia abilitato. <br /> 5. Quando utilizzi voci di menu associate, assicurati che il modulo venga visualizzato nelle pagine corrispondenti. <br />6. La visualizzazione delle bandiere o dei nomi è definita dall\'ordinamento in Gestione lingua - Lingue contenuti.<br ><br >Se questo modulo è pubblicato, è consigliato pubblicare il modulo amministrativo Stato multilingua.','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_languages.ini'),(2990,'MOD_LANGUAGES','Lingua','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_languages.sys.ini'),(2991,'MOD_LANGUAGES_XML_DESCRIPTION','Questo modulo visualizza la lista delle Lingue Contenuto disponibili (definite e pubblicate nel tab Contenuti della Gestione Lingua) per poterle intercambiare tra di loro e usare Joomla! come un sito multilingua. <br />-- Il plugin \'System - Language Filter\' dev\'essere abilitato. --<br /> Quando si cambia una lingua e se la voce di menu che visualizza la pagina non è associata ad un\'altra voce di menu, il modulo redireziona alla Home page definita per la lingua scelta. <br /> Altrimenti, se il parametro è impostato nel plugin Language Filter, redirezionerà alla voce di menu associata alla lingua scelta. Quindi, la navigazione sarà quella definita per la lingua.<br />Se il plugin <strong>\'System - Language Filter\'</strong> non è abilitato, potrebbero esserci dei risultati non desiderati.<br /><strong>Metodo:</strong><br />1. Apri il tab Contenuti in Gestione lingua ed assicurati che le lingue che vuoi utilizzare nei contenuti siano pubblicate e abbiano un prefisso per gli URL e un prefisso per l\'immagine utilizzata nel modulo.<br />2. Crea una Home page per ciascuna lingua pubblicata assegnando una lingua alla voce di menu e definendola come Home page predefinita. <br />  3. Quindi, puoi assegnare una lingua a qualsiasi articolo, categoria, modulo, newsfeed, link web in Joomla.<br /> 4. Assicurati che il modulo sia pubblicato e che il plugin sia abilitato. <br /> 5. Quando utilizzi voci di menu associate, assicurati che il modulo venga visualizzato nelle pagine corrispondenti. <br />6. La visualizzazione delle bandiere o dei nomi è definita dall\'ordinamento in Gestione lingua - Lingue contenuti.<br ><br >Se questo modulo è pubblicato, è consigliato pubblicare il modulo amministrativo Stato multilingua.','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_languages.sys.ini'),(2992,'MOD_LANGUAGES_LAYOUT_DEFAULT','Predefinito','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_languages.sys.ini'),(2993,'MOD_LOGIN','Login','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_login.ini'),(2994,'MOD_LOGIN_FIELD_GREETING_DESC','Mostra/nascondi un semplice testo di saluto','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_login.ini'),(2995,'MOD_LOGIN_FIELD_GREETING_LABEL','Mostra saluto','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_login.ini'),(2996,'MOD_LOGIN_FIELD_LOGIN_REDIRECTURL_DESC','Seleziona a quale pagina reindirizzare gli utenti dopo l\'accesso all\'area riservata. Seleziona una pagina tra tutte quelle elencate nel menu a tendina. Scegliendo \"Predefinito\" tornerà alla stessa pagina.','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_login.ini'),(2997,'MOD_LOGIN_FIELD_LOGIN_REDIRECTURL_LABEL','Redirezionamento dopo accesso','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_login.ini'),(2998,'MOD_LOGIN_FIELD_LOGOUT_REDIRECTURL_DESC','Seleziona a quale pagina reindirizzare gli utenti dopo l\'uscita dall\'area riservata. Seleziona una pagina tra tutte quelle elencate nel menu a tendina. Scegliendo \"Predefinito\" tornerà alla stessa pagina.','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_login.ini'),(2999,'MOD_LOGIN_FIELD_LOGO