iamo leggendo. Queste relazioni vengono stabilite grazie alle parole chiave presenti nei Metadata. <br />Il modulo ricerca le parole chiave inserite nei metadata dell\'articolo e visualizza tutti gli altri articoli che hanno una di queste parole chiave nei Metadata. Per esempio, possiamo avere un articolo intitolato \"Joomla italiano\" e un altro con titolo \"Uscito Joomla italiano\". Se inseriamo la parola chiave \"italiano\" nei Metadata di entrambi gli articoli, quando il modulo Articoli Correlati verrà aperto con l\'articolo dal titol \"Joomla Italiano\" verrà messo nella lista anche \"Uscito Joomla italiano\" e viceversa.','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_related_items.sys.ini'),(3068,'MOD_RELATED_ITEMS_LAYOUT_DEFAULT','Predefinito','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_related_items.sys.ini'),(3069,'MOD_SEARCH','Cerca','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_search.ini'),(3070,'MOD_SEARCH_FIELD_BOXWIDTH_DESC','Numero di caratteri del campo di ricerca','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_search.ini'),(3071,'MOD_SEARCH_FIELD_BOXWIDTH_LABEL','Larghezza campo','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_search.ini'),(3072,'MOD_SEARCH_FIELD_BUTTON_DESC','Visualizza un pulsante di ricerca','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_search.ini'),(3073,'MOD_SEARCH_FIELD_BUTTON_LABEL','Pulsante di ricerca','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_search.ini'),(3074,'MOD_SEARCH_FIELD_BUTTONPOS_DESC','Posizione del pulsante rispetto al campo di ricerca.','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_search.ini'),(3075,'MOD_SEARCH_FIELD_BUTTONPOS_LABEL','Posizione pulsante','/home/webcondo/public_html/jocondo/language/it-IT/it-IT.mod_search.ini'),(3076,'MOD_SEARCH_FIELD_BUTTONTEXT_DESC','Il testo che appare nel pulsante di ricerca. Se si lascia in vuoto, caricherà la stringa \'searchbutton\' del file lingua.